import React from 'react';
import './App.css';
import Header from './Header';


const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

const compromissos = ['Estudar', 'Pedalar', 'Fazer projetos'];

class App extends React.Component {
  render() {
    return (
      <ul>{ compromissos.map((compromisso) => Task(compromisso)) }</ul>
    );
  }
}

export default App;
